Export.Routine:
SYSTEM
	try {
		new $namespace 
		set $namespace = "USER"
		do ##class(isc.julia.Callout).Setup()
		set $namespace = "%SYS"
	} catch ex {
		zn "%SYS"
		do ex.Log()
	}
	quit 1

LOGIN  
	try {
		new $namespace 
		set $namespace = "USER"
		do ##class(isc.julia.Callout).Initialize("libjulia.so")
	} catch ex {
		zn "%SYS"
		do ex.Log()
	}
	quit 1
